import React, { useState } from 'react'
import { Link,} from 'react-router-dom';
import "./Topbar.css"



function Topbar() {
  const [clicked, setclicked] =  useState(false);
  const handleClick = ()=> {
    setclicked(!clicked);
  }
  return (
    <div className='main'>
         <div className="leftmenue">
        <div className="logo">
          <Link to="/">
            <img
              className="imglogo"
              src="https://edu-web-fundamentals.web.app/static/media/logo.58169365.png"
              alt="kafenelogo"
            />
          </Link>
        </div>
        </div>
        <h1>Kafene</h1>
        <div className="rightmenue">
          <div className="menue-iteam">
          <Link to="/"  className={`order ${clicked ? 'active' : ''}`}
            onClick={handleClick}> Order</Link>
            <div></div>
          <Link to="/" className={`product ${clicked ? 'active' : ''}`}
            onClick={handleClick}>Products</Link>
          <Link to="/" className={`users ${clicked ? 'active' : ''}`}
            onClick={handleClick}>Users</Link>
         
          </div>
          <Link to="/" className='logoutbtn'>Logout</Link>
        </div>
    </div>
  )
}

export default Topbar
